import React, { Component } from "react";

class RadioButton extends Component {
  render() {
    const { value, handleGenerico } = this.props;

    return (
        <div className="checkbox">
          <label htmlFor="">
          <input
            type="radio"
            name="casa"
            className="checkbox"
            value={value}
            onChange={handleGenerico}
            />Casa
          <input
            type="radio"
            className="checkbox"
            name="ap"
            value={value}
            onChange={handleGenerico}
          />Apartamento
          </label>
        </div>
    );
  }
}

export default RadioButton;
